import Player from '../../models/Player';
import Dado from '../../components/Dado';

function Home(props) {

    const [ dado, setDado ] = useState(new Dado());

    useEffect(() => {
        jogarDado();
    }, [] )

    function jogarDado() {
        const dado = new  Dado();
        dado.jogarDado();
        setDado(dado);
    }

    return (<>
        <div className="col-xl-12 mt-3">
            <Dado dado={dado.getNumero} />
        </div>
    </>)
}

export default Home;
